import Android from '../src/images/Android.jpg';
//import web from '../src/images/robo.jpg';
import App from '../src/images/App.jpg';
import Apple from '../src/images/Apple.jpg';
import Digital from '../src/images/Digital.jpg';
import Marketing from '../src/images/Marketing.jpg';
import Software from '../src/images/Software.png';

const Data = [
    {
        imgsrc: Android,
        title: "Android Development",
    },
    {
        imgsrc: App,
        title: "App Development",
    },
     {
        imgsrc: Digital,
        title: "Digital Development",
    },
    {
        imgsrc: Marketing,
        title:"Marketing Development",
    },
    {
        imgsrc: Apple,
        title: "Apple Development",
    },
    {
        imgsrc: Software,
        title: "Software Development",
    },

];
    
export default Data;
